} contract SafeTest is Test { Safe safe; // Needed so the test contract itself can receive ether // when withdrawing receive() external payable {} function setUp() public { safe = new Safe(); } function testWithdraw() public { payable(address(safe)).transfer(1 ether); uint256 preBalance = address(this).balance; safe.withdraw(); uint256 postBalance = address(this).balance; assertEq(preBalance + 1 ether, postBalance); }
} Running the test, we see it passes: $ forge test
