pragma solidity 0.8.13; contract SigUtils { bytes32 internal DOMAIN_SEPARATOR; constructor(bytes32 _DOMAIN_SEPARATOR) { DOMAIN_SEPARATOR = _DOMAIN_SEPARATOR; } // keccak256("Permit(address owner,address spender,uint256 value,uint256 nonce,uint256 deadline)"); bytes32 public constant PERMIT_TYPEHASH = 0x6e71edae12b1b97f4d1f60370fef10105fa2faae0126114a169c64845d6126c9; struct Permit { address owner; address spender; uint256 value; uint256 nonce; uint256 deadline; } // computes the hash of a permit function getStructHash(Permit memory _permit) internal pure returns (bytes32) { return keccak256( abi.encode( PERMIT_TYPEHASH, _permit.owner, _permit.spender, _permit.value, _permit.nonce, _permit.deadline ) ); } // computes the hash of the fully encoded EIP-712 message for the domain, which can be used to recover the signer function getTypedDataHash(Permit memory _permit) public view returns (bytes32) { return keccak256( abi.encodePacked( "\x19\x01", DOMAIN_SEPARATOR, getStructHash(_permit) ) ); }
} Setup Deploy a mock ERC-20 token and SigUtils helper with the token's EIP-712 domain separator Create private keys to mock the owner and spender Derive their addresses using the vm.addr cheatcode Mint the owner a test token contract ERC20Test is Test { MockERC20 internal token; SigUtils internal sigUtils; uint256 internal ownerPrivateKey; uint256 internal spenderPrivateKey; address internal owner; address internal spender; function setUp() public { token = new MockERC20(); sigUtils = new SigUtils(token.DOMAIN_SEPARATOR()); ownerPrivateKey = 0xA11CE; spenderPrivateKey = 0xB0B; owner = vm.addr(ownerPrivateKey); spender = vm.addr(spenderPrivateKey); token.mint(owner, 1e18); } Testing: permit Create an approval for the spender Compute its digest using sigUtils.getTypedDataHash Sign the digest using the vm.sign cheatcode with the owner's private key Store the uint8 v, bytes32 r, bytes32 s of the signature Call permit with the signed permit and signature to execute the approval on-chain function test_Permit() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 1e18, nonce: 0, deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(ownerPrivateKey, digest); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); assertEq(token.allowance(owner, spender), 1e18); assertEq(token.nonces(owner), 1); } Ensure failure for calls with an expired deadline, invalid signer, invalid nonce, and signature replay function testRevert_ExpiredPermit() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 1e18, nonce: token.nonces(owner), deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(ownerPrivateKey, digest); vm.warp(1 days + 1 seconds); // fast forward one second past the deadline vm.expectRevert("PERMIT_DEADLINE_EXPIRED"); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); } function testRevert_InvalidSigner() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 1e18, nonce: token.nonces(owner), deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(spenderPrivateKey, digest); // spender signs owner's approval vm.expectRevert("INVALID_SIGNER"); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); } function testRevert_InvalidNonce() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 1e18, nonce: 1, // owner nonce stored on-chain is 0 deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(ownerPrivateKey, digest); vm.expectRevert("INVALID_SIGNER"); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); } function testRevert_SignatureReplay() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 1e18, nonce: 0, deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(ownerPrivateKey, digest); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); vm.expectRevert("INVALID_SIGNER"); token.permit( permit.owner, permit.spender, permit.value, permit.deadline, v, r, s ); } Testing: transferFrom Create, sign, and execute an approval for the spender Call tokenTransfer as the spender using the vm.prank cheatcode to execute the transfer function test_TransferFromLimitedPermit() public { SigUtils.Permit memory permit = SigUtils.Permit({ owner: owner, spender: spender, value: 1e18, nonce: 0, deadline: 1 days }); bytes32 digest = sigUtils.getTypedDataHash(permit); (uint8 v, bytes32 r, bytes32 s) = vm.sign(ownerPrivateKey, digest); token.permit( permit.owner, permit.spender, permit.value